import React from 'react';
import classes from './NavItemDropdown.module.css';

class navItemDropwdown extends React.Component {
    state = {
        isVisible: false
    }
    render() {
        return (
            <div className={classes.NavItemDropdown}>
                <button onClick={this.setState({isVisible: true})}>
                    PROJECTS
                </button>
                <div className={classes.DropdownContent}>
                    <a href="/">E-Commerce App</a>
                    <a href="/">Winery Landing Page</a>
                    <a href="/">Weather Finder</a>
                </div>
            </div>
        )
    }
}

export default navItemDropwdown;
